const cardKey = "p7bgC3EKwo0IGdZ2"

// CardEncrypt 身份证相关加密
func CardEncrypt(card string) string {
	v, _ := zstring.AesGCMEncryptString(card, cardKey)
	return v
}

// CardDecrypt 身份证相关解密
func CardDecrypt(card string) string {
	v, _ := zstring.AesGCMDecryptString(card, cardKey)
	return v
}
